import { useState, useEffect } from 'react';
import './App.css';
import { API, graphqlOperation  } from 'aws-amplify';
import { listProteinAnnotationTables } from './graphql/queries';


//const initialState  = { name: '', description: '' }

function Predictions() {

  //const [formState, setFormState] = useState(initialState)
  const [predictions, setPredictions] = useState([]);


  useEffect(() => {
    fetchPredictions();
  }, []);

  async function fetchPredictions() {
    try {
      const todoData = await API.graphql(graphqlOperation(listProteinAnnotationTables));
      const predictions = todoData.data.listProteinAnnotationTables.items;
      console.log("Predictions...", predictions);

      setPredictions(predictions);
    } catch (err) { console.log('error fetching predictions') }
  }

  return (
    <div className="App">
      <h1>Predictions</h1>
      <div style={{marginBottom: 30}}>
        {
          predictions.map(note => (
            <div key={note.familyAccession}>
              <p>{note.familyAccession}</p>
              <p>{note.confidence}</p>
              <p>{note.description}</p>
              <p>{note.familyID}</p>
              <p>{note.inputSequence}</p>
              <p>{note.itemID}</p>
              <p>{note.userID}</p>
              <p>End...</p>
            </div>
          ))
        }
      </div>

    </div>
  );
}

export default Predictions;
